class CssCodes extends Component {
  componentDidMount() {
    setTimeout(() => Prism.highlightAll(), 0);
  }
  render() {
    const { classes } = this.props;
    return (
      <Grid container>
        <Grid item xs={2}>
          <Paper className={classes.paper}>
            <h4>
              <Sidebar />
            </h4>
          </Paper>
        </Grid>
        <Grid item xs={10}>
          <Paper className={classes.paper}>
            <List>
              <h3>Three imgege in row(flex)</h3>
              <div style={titles}>
                <PrismCode
                  code={flextFloat}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <br />

              <h3></h3>

              <div style={titles}>
                <PrismCode
                  code={flextFloat}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <br />

              <h3></h3>

              <div style={titles}>
                <PrismCode
                  code={flextFloat}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <br />

              <h3></h3>

              <div style={titles}>
                <PrismCode
                  code={flextFloat}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <br />

              <h3></h3>

              <div style={titles}>
                <PrismCode
                  code={flextFloat}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
